select C.회사이름, C.ISIN, D.MP날짜, min(D.종가) as MIN종가 from company C inner join daymarkepprice D where D.MP날짜='2018-11-25';/*날짜별 최고 최저의 시세 조회 - 어떤 날의 시세중 최고 최저의 시세를 조회- 최고만 조회하는걸로 바꿈 최고만 조회하자 생각해보니 최고인회사 최저인회사 다른데 테이블 같이 못둘듯*/
select C.회사이름; /*두 회사의 시세 정보 비교 조회 - 2개의 회사와 2개회사의 시세정보들중 컬럼 1개를 선택해서 전체 날짜 별로 비교하고 그 차이를 보여주는 기능*/
select C.ISIN, C.회사이름, avg(D.종가) as AVG종가, max(D.종가) as MAX종가 from company C inner join daymarkepprice D group by C.ISIN;/*회사별 1달 종가의 평균,  1달 최대 종가 조회 - 회사별로 1달 종가 평균, 1달중 최대 종가를 조회한다.*/

select C.회사이름, C.ISIN, D.MP날짜,  min(D.종가) as MIN종가, max(D.종가) as MAX종가 from company C inner join daymarkepprice D where D.MP날짜='2018-11-25';
select C1.회사이름, C1.ISIN, D1.종가, c2.회사이름, C2.ISIN, D2.종가, D1.MP날짜 from company C1 inner join daymarkepprice D1, company C2 inner join daymarkepprice D2 where C1.회사이름='동화약품' and c2.회사이름='우리은행' order by D2.MP날짜 desc; /*order by MP날짜 desc;회사 -> ISIN 입력시*/

select C.회사이름, C.ISIN, D.MP날짜, D.종가, D.거래량 from company C inner join daymarkepprice D where C.회사이름='우리은행' union select C.회사이름, C.ISIN, D.MP날짜, D.종가, D.거래량 from company C inner join daymarkepprice D where C.회사이름='경방' order by MP날짜 desc;
select C.회사이름, C.ISIN, D.MP날짜, D.종가 from company C inner join daymarkepprice D where C.회사이름='우리은행' union select C.회사이름, C.ISIN, D.MP날짜, D.종가 from company C inner join daymarkepprice D where C.회사이름='경방';

